import React from 'react';

import NethreSQ from '../../images/Crew/Nethre.jpg';
import SupipiSQ from '../../images/Crew/supipi.jpg';
import NaveenSQ from '../../images/Crew/navvensmall2.png';
import ShenalSQ from '../../images/Crew/shenalS.png';
import AkshiSQ from '../../images/Crew/Akshi.jpg';
import LakinduSQ from '../../images/Crew/Lakindu.jpg';

import Nethre300 from '../../images/Crew/nethre300x300C.png';
import Supipi300 from '../../images/Crew/Supipi.png';
import Naveen300 from '../../images/Crew/naveen300x300C.png';
import Shenal300 from '../../images/Crew/Shenal300x300C.png';
import Akshi300 from '../../images/Crew/Akshi300x300C.png';
import Lakindu300 from '../../images/Crew/Lakindu300x300.png';

const Content = [
    {
        id: 'nethre',
        sq_pic: NethreSQ,
        name: 'Nethre Perera',
        degree: 'Computer Science',
        tasks: '',
        rnd_pic: Nethre300,
        facebook: '',
        linkedIn: 'https://www.linkedin.com/in/nethre-perera-5789a71b8',
        github: '',
             
    },{
        id: 'supipi',
        sq_pic: SupipiSQ,
        name: 'Supipi Handunpathirana',
        degree: 'Software Engineer',
        tasks: '',
        rnd_pic: Supipi300,
        facebook: '',
        linkedIn: 'https://www.linkedin.com/in/supipi-nelumika-16289b1ab',
        github: '',
        
    },{
        id: 'naveen',
        sq_pic: NaveenSQ,
        name: 'Naveen Adhikari',
        degree: 'Computer Science',
        tasks: '',
        rnd_pic: Naveen300,
        facebook: '',
        linkedIn: '',
        github: '',
        
    },{
        id: 'shenal',
        sq_pic: ShenalSQ,
        name: 'Shenal Imesh',
        degree: 'Software Engineering',
        tasks: '',
        rnd_pic: Shenal300,
        facebook: '',
        linkedIn: '',
        github: '',
        
    },{
        id: 'lakindu',
        sq_pic: LakinduSQ,
        name: 'Lakindu Lankageeganage',
        degree: 'Software Engineering',
        tasks: '',
        rnd_pic: Lakindu300,
        facebook: '',
        linkedIn: 'https://www.linkedin.com/in/lakindu-lankageeganage-0746481a6',
        github: '',
        
    },{
        id: 'akshi',
        sq_pic: AkshiSQ,
        name: 'Akshi Mahakumarage',
        degree: 'Computer Science',
        tasks: '',
        rnd_pic: Akshi300,
        facebook: '',
        linkedIn: 'https://www.linkedin.com/in/akshi-mahakumarage-0394a71a6',
        github: '',
        
    }
];

const rotate = () => {
    var aboutShowCase = $('#aboutTshowcase')

    aboutShowCase.Cloud9Carousel({

    })
}

const AboutUs = () => {
    return (
        <div className='aboutMember' id='aboutUs'>
            <div className='aboutTeamWrap'>
                {Content.map((cont,index) => (
                    <div id='aboutTshowcase' key={index}>
                        <a href={cont.id}><img src={cont.rnd_pic} alt={cont.name}/></a>
                    </div>
                ))}
                {Content.map((prop,index) => (
                    <div className='sectionAbout' key={index} id={prop.id}>
                        <div className='close'>&times;</div>
                        <img src={prop.sq_pic} alt={prop.name} type='jpg/png'/>
                        <div className='description'>
                            <h2><strong>{prop.name}</strong></h2>
                            <p>{prop.degree}</p>
                        </div>
                    </div>
                ))}
            </div>
            <div className="navAbout noselect">
                <button className="left"><i className="fa fa-arrow-left"></i></button>
                <button className="right"><i className="fa fa-arrow-right"></i></button>
            </div>
        </div>
    )
}

export default AboutUs
